import itertoolsclass Solution:    def findSubsequences(self, nums):        ret = []        for i in range(2, len(nums) + 1):            ret.extend(set(itertools.combinations(nums, i)))        return [x for x in ret if self.isIncreasing(x)]    def isIncreasing(self, l):        for i in range(1, len(l)):            if l[i - 1] > l[i]:                return False        return True